<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no, viewport-fit=cover">
<meta name="mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-status-bar-style" content="black-fullscreen">
<meta name="theme-color" content="#000">
<title>1000 in 1 ‚Äî NES</title>
<style>
*{margin:0;padding:0;box-sizing:border-box;-webkit-tap-highlight-color:transparent;}
:root{
  --c1:#ff4400;--c2:#ffcc00;--c3:#00ff88;--c4:#00aaff;--c5:#ff00ff;
  --dk:#000005;--btn:#080010;--bb:#221100;--ba:#aa4400;--tx:#ffddaa;
}
html,body{width:100%;height:100%;background:#000;overflow:hidden;font-family:'Courier New',monospace;touch-action:none;}

/* SPLASH */
#splash{
  position:fixed;inset:0;z-index:999;
  background:radial-gradient(ellipse at 50% 40%,#1a0a00 0%,#080005 50%,#000 100%);
  display:flex;flex-direction:column;align-items:center;justify-content:center;gap:10px;
  overflow:hidden;
}

/* Rainbow top ticker */
#splash::before{
  content:'NES ¬∑ MARIO ¬∑ CONTRA ¬∑ ZELDA ¬∑ METROID ¬∑ MEGAMAN ¬∑ CASTLEVANIA ¬∑ EXCITEBIKE ¬∑ DUCKTALES ¬∑ KIRBY';
  position:absolute;top:0;left:0;right:0;
  background:#111;color:#555;font-size:8px;letter-spacing:2px;
  padding:5px 0;white-space:nowrap;overflow:hidden;
  animation:ticker 15s linear infinite;
}
@keyframes ticker{from{text-indent:100%}to{text-indent:-200%}}

/* Bottom ticker */
#splash::after{
  content:'PAC-MAN ¬∑ DONKEY KONG ¬∑ GALAGA ¬∑ TETRIS ¬∑ BALLOON FIGHT ¬∑ ICE CLIMBER ¬∑ KUNG FU ¬∑ NINJA GAIDEN';
  position:absolute;bottom:15%;left:0;right:0;
  background:#111;color:#444;font-size:8px;letter-spacing:2px;
  padding:5px 0;white-space:nowrap;overflow:hidden;
  animation:ticker2 18s linear infinite reverse;
}
@keyframes ticker2{from{text-indent:100%}to{text-indent:-200%}}

/* Rainbow number */
#splash h1{
  font-size:clamp(60px,22vw,120px);
  background:linear-gradient(90deg,var(--c1),var(--c2),var(--c3),var(--c4),var(--c5),var(--c1));
  background-size:200% auto;
  -webkit-background-clip:text;-webkit-text-fill-color:transparent;background-clip:text;
  animation:rainbow 2s linear infinite;
  letter-spacing:-2px;line-height:1;
  filter:drop-shadow(0 0 20px #ff440088);
}
@keyframes rainbow{to{background-position:200% center}}

#splash h2{
  font-size:clamp(14px,5vw,24px);
  color:var(--c2);letter-spacing:5px;
  text-shadow:0 0 15px var(--c2),2px 2px 0 #664400;
  text-transform:uppercase;
}

#splash h3{
  font-size:clamp(10px,3vw,14px);
  color:var(--c3);letter-spacing:3px;
  text-shadow:0 0 10px var(--c3);
  animation:blink 1s step-end infinite;
}
@keyframes blink{0%,100%{opacity:1}50%{opacity:0}}

/* Game icons row */
.icons{font-size:24px;letter-spacing:4px;animation:iconbounce .6s ease-in-out infinite alternate;}
@keyframes iconbounce{from{transform:translateY(0)}to{transform:translateY(-6px)}}

#splash .platform{
  color:var(--tx);font-size:clamp(7px,2vw,9px);
  letter-spacing:3px;border:1px solid #331100;
  padding:4px 14px;background:rgba(0,0,0,0.6);
}

#play-btn{
  padding:14px 48px;background:transparent;
  border:2px solid var(--c1);color:var(--c1);
  font-family:'Courier New',monospace;font-size:clamp(13px,3.5vw,16px);
  letter-spacing:4px;cursor:pointer;text-transform:uppercase;
  animation:glw 1.2s ease-in-out infinite;margin-top:4px;
}
@keyframes glw{
  0%,100%{box-shadow:0 0 12px #ff440099;border-color:var(--c1);color:var(--c1);}
  33%{box-shadow:0 0 20px #ffcc0099;border-color:var(--c2);color:var(--c2);}
  66%{box-shadow:0 0 20px #00ff8899;border-color:var(--c3);color:var(--c3);}
}
#play-btn:active{background:var(--c1);color:#000;animation:none;}

/* APP */
#app{display:none;flex-direction:column;width:100%;height:100%;}

#topbar{
  height:36px;min-height:36px;
  background:linear-gradient(90deg,#000,#0d0800,#000);
  border-bottom:2px solid #221100;
  display:flex;align-items:center;justify-content:space-between;padding:0 12px;flex-shrink:0;
}
#topbar .logo{
  background:linear-gradient(90deg,var(--c1),var(--c2),var(--c3));
  -webkit-background-clip:text;-webkit-text-fill-color:transparent;background-clip:text;
  font-size:11px;letter-spacing:3px;
}
.tbtn{background:none;border:1px solid #221100;color:var(--tx);font-size:15px;padding:3px 9px;cursor:pointer;border-radius:3px;}
.tbtn:active{background:var(--ba);color:#fff;}

#screen{
  flex:1;background:#000;display:flex;align-items:center;justify-content:center;
  position:relative;overflow:hidden;min-height:0;
}
#screen::after{
  content:'';position:absolute;inset:0;pointer-events:none;z-index:5;
  background:repeating-linear-gradient(0deg,transparent,transparent 2px,rgba(0,0,0,.08) 2px,rgba(0,0,0,.08) 4px);
}
#game{width:100%;height:100%;display:flex;align-items:center;justify-content:center;}
#game canvas{image-rendering:pixelated;image-rendering:crisp-edges;display:block;}

#loader{
  position:absolute;inset:0;z-index:10;
  background:radial-gradient(ellipse at center,#080005 0%,#000 100%);
  display:flex;flex-direction:column;align-items:center;justify-content:center;gap:14px;
}
#loader .l-icon{
  font-size:42px;
  animation:spin 1s linear infinite;
}
@keyframes spin{to{transform:rotate(360deg)}}
#loader h2{
  font-size:clamp(16px,5vw,28px);letter-spacing:4px;text-align:center;
  background:linear-gradient(90deg,var(--c1),var(--c2),var(--c3),var(--c4));
  background-size:200% auto;animation:rainbow 2s linear infinite;
  -webkit-background-clip:text;-webkit-text-fill-color:transparent;background-clip:text;
}
#loader h3{color:var(--c2);font-size:clamp(9px,2.5vw,12px);letter-spacing:3px;}
#lbar-wrap{width:230px;height:8px;border:1px solid #221100;background:#050000;}
#lbar{
  height:100%;width:0%;
  background:linear-gradient(90deg,var(--c1),var(--c2),var(--c3),var(--c4));
  background-size:200% auto;animation:rainbow 1s linear infinite;
  box-shadow:0 0 8px var(--c2);transition:width .25s;
}
#lmsg{color:#443322;font-size:8px;letter-spacing:2px;}
#lerr{color:#ff4444;font-size:9px;display:none;text-align:center;max-width:280px;line-height:1.8;}
</style>
</head>

function b64ToBytes(b64) {
  const s = atob(b64);
  const u = new Uint8Array(s.length);
  for (let i = 0; i < s.length; i++) u[i] = s.charCodeAt(i);
  return u;
}

function boot() {
  document.getElementById('splash').style.display = 'none';
  document.getElementById('app').style.display = 'flex';
  loadEmulator();
}

function setProgress(pct, msg) {
  document.getElementById('lbar').style.width = pct + '%';
  document.getElementById('lmsg').textContent = msg;
}

function showError(msg) {
  const e = document.getElementById('lerr');
  e.textContent = msg; e.style.display = 'block';
  setProgress(100, 'ERROR');
  document.getElementById('lbar').style.background = '#ff2200';
}

function loadEmulator() {
  setProgress(10, 'DECODIFICANDO ROM...');
  let romBytes;
  try {
    romBytes = b64ToBytes(ROM_B64);
    setProgress(30, 'ROM OK ‚Äî ' + (romBytes.length / 1024).toFixed(0) + 'KB');
  } catch(e) { showError('Error ROM: ' + e.message); return; }

  const romBlob = new Blob([romBytes], {type:'application/octet-stream'});
  const romURL  = URL.createObjectURL(romBlob);

  setProgress(40, 'CARGANDO EMULADOR NES...');

  window.EJS_player          = '#game';
  window.EJS_core            = 'fceumm';
  window.EJS_gameUrl         = romURL;
  window.EJS_gameName        = '1000 in 1';
  window.EJS_color           = '#ff4400';
  window.EJS_backgroundColor = '#000000';
  window.EJS_startOnLoaded   = true;
  window.EJS_pathtodata      = 'https://cdn.emulatorjs.org/stable/data/';
  window.EJS_VirtualGamepad  = true;
  window.EJS_Buttons = {
    gamepad:true, mute:true, settings:true, fullscreen:false,
    save:true, load:true, screenshot:false, cheat:false,
    volume:true, quickSave:true, quickLoad:true,
    zoom:false, crt:false, ratio:false, reset:true,
  };
  window.EJS_defaultOptions = {
    'save-state-slot': 1,
    'video-smooth': false,
  };

  window.EJS_onLoadProgress = function(p) {
    setProgress(40 + p * 55, 'CARGANDO CORE NES... ' + Math.round(p*100) + '%');
  };

  window.EJS_onGameStart = function() {
    setProgress(100, '¬°1000 JUEGOS LISTOS!');
    setTimeout(() => { document.getElementById('loader').style.display = 'none'; }, 600);
  };

  const s = document.createElement('script');
  s.src = 'https://cdn.emulatorjs.org/stable/data/loader.js';
  s.onerror = () => {
    const s2 = document.createElement('script');
    s2.src = 'https://cdn.jsdelivr.net/npm/emulatorjs@latest/data/loader.js';
    s2.onerror = () => showError('No se pudo cargar EmulatorJS.\nVerifica tu conexi√≥n a internet.');
    document.head.appendChild(s2);
  };
  document.head.appendChild(s);

  let fake = 40;
  const iv = setInterval(() => {
    if (document.getElementById('loader').style.display === 'none') { clearInterval(iv); return; }
    fake = Math.min(fake + 1.5, 94);
    if (fake < 94) setProgress(fake, 'CARGANDO 1000 JUEGOS...');
  }, 300);
}

function toggleFS() {
  if (!document.fullscreenElement) {
    document.documentElement.requestFullscreen({navigationUI:'hide'}).catch(()=>{});
    if (screen.orientation?.lock) screen.orientation.lock('landscape').catch(()=>{});
  } else { document.exitFullscreen?.(); }
}

let muted = false;
function toggleMute() {
  muted = !muted;
  document.getElementById('muteBtn').textContent = muted ? 'üîá' : 'üîä';
  if (window.EJS_emulator?.setVolume) EJS_emulator.setVolume(muted ? 0 : 1);
  document.querySelectorAll('audio,video').forEach(a => a.muted = muted);
}

document.addEventListener('touchmove', e => { if (e.touches.length > 1) e.preventDefault(); }, {passive:false});
document.addEventListener('gesturestart', e => e.preventDefault(), {passive:false});
</script>
